.bill-item { padding: 0px 0.3rem; font-size: 0.28rem; background-color: rgb(255, 255, 255); border-radius: 0.26rem; }.bill-item-hd { position: relative; display: flex; height: 0.76rem; align-items: center; border-bottom: 0.02rem solid rgb(227, 227, 227); }@media (-webkit-min-device-pixel-ratio: 2), (min-resolution: 2dppx) {
  html:not([data-scale]) .bill-item-hd { border-bottom: none; }
  html:not([data-scale]) .bill-item-hd::after { content: ""; position: absolute; background-color: rgb(227, 227, 227); display: block; z-index: 1; inset: auto auto 0px 0px; width: 100%; height: 0.02rem; transform-origin: 50% 100%; transform: scaleY(0.5); }
}@media (-webkit-min-device-pixel-ratio: 2) and (-webkit-min-device-pixel-ratio: 3), (min-resolution: 2dppx) and (min-resolution: 3dppx) {
