}.bill-item-hd span + span, .bill-item-hd .ml-tag { margin-left: 0.3rem; }.bill-item-hd span:first-of-type { font-weight: 500; }.bill-item-bd { display: flex; align-items: center; height: 1.72rem; }.bill-item-ft { position: relative; padding: 0.2rem 0px; line-height: 0.4rem; color: rgb(85, 85, 85); font-size: 0.24rem; border-top: 0.02rem solid rgb(227, 227, 227); }@media (-webkit-min-device-pixel-ratio: 2), (min-resolution: 2dppx) {
  html:not([data-scale]) .bill-item-ft { border-top: none; }
  html:not([data-scale]) .bill-item-ft::before { content: ""; position: absolute; background-color: rgb(227, 227, 227); display: block; z-index: 1; inset: 0px auto auto 0px; width: 100%; height: 0.02rem; transform-origin: 50% 50%; transform: scaleY(0.5); }
}@media (-webkit-min-device-pixel-ratio: 2) and (-webkit-min-device-pixel-ratio: 3), (min-resolution: 2dppx) and (min-resolution: 3dppx) {
  html:not([data-scale]) .bill-item-ft::before { transform: scaleY(0.33); }
}.bill-item-opr { flex: 0 0 auto; display: flex; align-items: center; box-sizing: border-box; position: relative; }.bill-item-opr .bill-status { color: rgb(82, 82, 82); }.bill-item-opr .qutixian { position: absolute; top: 0.44rem; right: 0px; color: rgb(0, 50, 161); font-size: 0.24rem; }.bill-item-quanyi { position: relative; display: flex; align-items: center; padding: 0.2rem 0px; }.bill-item-quanyi .quanyi-item { color: rgb(61, 61, 61); }.bill-item-quanyi .quanyi-item .quanyi-item-name { font-size: 0.24rem; }.bill-item-quanyi .quanyi-item .quanyi-item-name-label { color: rgb(233, 0, 0); margin-left: 0.1rem; }.bill-item-quanyi .quanyi-item .quanyi-item-time { font-size: 0.2rem; padding-bottom: 0.02rem; }.bill-item-quanyi .quanyi-item .overdue { font-size: 0.24rem; margin-left: 0.2rem; }.bill-item-quanyi .quanyi-amount { flex: 1 1 0%; font-size: 0.28rem; font-weight: 500; color: rgb(51, 51, 51); text-align: center; }.bill-item-quanyi-gopay { flex: 0 0 auto; color: rgb(0, 50, 161); font-size: 0.24rem; }.bill-item-quanyi.bill-item-quanyi-overdue .quanyi-item-name-label, .bill-item-quanyi.bill-item-quanyi-overdue .quanyi-amount, .bill-item-quanyi.bill-item-quanyi-overdue .bill-item-quanyi-gopay { color: rgb(233, 0, 0); }.bill-item-servers-wrapper { display: flex; font-size: 0.24rem; }.bill-item-servers-wrapper-l { flex: 1 1 0%; color: rgb(85, 85, 85); }.bill-item-servers-wrapper-r { color: rgb(0, 50, 161); font-size: 0.24rem; }.bill-item .amount-item { flex: 1 1 0%; text-align: center; }.bill-item .amount-item-value { font-size: 0.42rem; }.bill-item .amount-item-value p { font-size: 0.28rem; }.bill-item .amount-item-title { margin-top: 0.04rem; line-height: 0.4rem; color: rgb(117, 117, 117); }

@keyframes skeleton-loading { 
  0% { background-position: 100% 50%; }
  100% { background-position: 0px 50%; }
}.bill-item-skeleton { padding-left: 0.3rem; background-color: rgb(255, 255, 255); border-radius: 0.26rem; }.bill-item-skeleton-hd .skeleton-item, .bill-item-skeleton-bd .skeleton-item { border-radius: 0.08rem; background: linear-gradient(90deg, rgb(242, 242, 242) 25%, rgb(230, 230, 230) 37%, rgb(242, 242, 242) 63%) 0% 0% / 400% 100%; animation: 1.4s ease 0s infinite normal none running skeleton-loading; }.bill-item-skeleton-hd { position: relative; display: flex; height: 0.76rem; align-items: center; border-bottom: 0.02rem solid rgb(227, 227, 227); }@media (-webkit-min-device-pixel-ratio: 2), (min-resolution: 2dppx) {
