}.bill-item-skeleton-hd .skeleton-item { width: 3.16rem; height: 0.38rem; }.bill-item-skeleton-bd { display: flex; align-items: center; height: 1.72rem; }.bill-item-skeleton-bd .item { display: flex; flex-direction: column; align-items: center; }.bill-item-skeleton-bd .skeleton-item:first-of-type { width: 2rem; height: 0.58rem; }.bill-item-skeleton-bd .skeleton-item:last-of-type { margin-top: 0.04rem; width: 1.12rem; height: 0.4rem; }
